A Fé e a Inteligência trabalham juntas.
Embora a Fé seja encarada como loucura para este mundo;
ela é Inteligênte porquê nos faz saber, que temos direito à felicidade.
A Fé faz com que recusemos uma vida de derrotas;
e conquistemos uma vida de vitórias.
Se tudo não está de acordo com os seus ideais.
Está na hora de você refletir com a sua Inteligência;
e usar a sua Fé para trazer a existência os desejos de seu coração.

